import React from 'react';
import OTPForm from './components/OTPForm';
import OTPVerification from './components/OTPVerification';
import './App.css';
function App() {
  return (
    <div className="App">
      <h1>OTP Location-Based Verification</h1>
      <div class="form">
      <OTPForm />  {/* Component to send OTP */}
      <OTPVerification />  {/* Component to verify transaction */}
      </div>
    </div>
  );
}



export default App;
